// SPDX-License-Identifier: MIT
pragma solidity ^0.8.18;

    /*
    간단한 게임이 있습니다.
    유저는 번호, 이름, 주소, 잔고, 점수를 포함한 구조체입니다. 
    참가할 때 참가비용 1ETH를 내야합니다. (payable 함수)
    4명까지만 들어올 수 있는 방이 있습니다. (array)
    선착순 4명에게는 각각 4,3,2,1점의 점수를 부여하고 4명이 되는 순간 방이 비워져야 합니다.

    예) 
    간단한 게임이 있습니다.

    참가할 때 참가비용 0.01ETH를 내야합니다.
    4명까지만 들어올 수 있는 방이 있습니다.
    선착순 4명에게는 각각 4,3,2,1점의 점수를 부여하고 4명이 되는 순간 방이 비워져야 합니다.

    예) 
    방 안 : "empty" 
    -- A 입장 --
    방 안 : A 
    -- B, D 입장 --
    방 안 : A , B , D 
    -- F 입장 --
    방 안 : A , B , D , F 
    A : 4점, B : 3점 , D : 2점 , F : 1점 부여 후 
    방 안 : "empty" 

    유저는 10점 단위로 점수를 0.1ETH만큼 변환시킬 수 있습니다.
    예) A : 12점 => A : 2점, 0.1ETH 수령 // B : 9점 => 1점 더 필요 // C : 25점 => 5점, 0.2ETH 수령

    * 유저 등록 기능 - 유저는 이름만 등록, 번호는 자동적으로 순차 증가, 주소도 자동으로 설정, 점수도 0으로 시작
    * 유저 조회 기능 - 유저의 전체정보 번호, 이름, 주소, 점수를 반환. 
    * 게임 참가시 참가비 제출 기능 - 참가시 0.01eth 지불 (돈은 smart contract가 보관)
    * 점수를 돈으로 바꾸는 기능 - 10점마다 0.1eth로 환전
    * 관리자 인출 기능 - 관리자는 0번지갑으로 배포와 동시에 설정해주세요, 관리자는 원할 때 전액 혹은 일부 금액을 인출할 수 있음 (따로 구현)
    ---------------------------------------------------------------------------------------------------
    * 예치 기능 - 게임할 때마다 참가비를 내지 말고 유저가 일정금액을 미리 예치하고 게임할 때마다 자동으로 차감시키는 기능.
    */

contract codingTest {
    struct User {
        uint number;
        string name;
        address ad;
        uint balance;
        uint score;
    }

    User[] UserData;
    uint count;
    address GameManager;

    constructor() {
        GameManager = address(this);
    }

    modifier onlyManager() {
        require(msg.sender == GameManager, "You are not the game manager");
        _;
    }

    // 게임 참가시 참가비 제출 기능 - 참가시 0.01eth 지불 (돈은 smart contract가 보관)
    function GameStart(uint _n) public {
        require(count < 5, "maximum number of people is 4");
        UserData[_n-1].balance -= 0.01 ether;
        payable(GameManager).transfer(0.01 ether);
        if(count == 1) {
            UserData[_n-1].score += 4;
        } else if(count == 2) {
            UserData[_n-1].score += 3;
        } else if(count == 3) {
            UserData[_n-1].score += 2;
        } else if(count == 4) {
            UserData[_n-1].score += 1;
            count = 0;
        }
    }

    // 유저 등록 기능 - 유저는 이름만 등록, 번호는 자동적으로 순차 증가, 주소도 자동으로 설정, 점수도 0으로 시작
    function setUser(string memory _name) public {
        UserData.push(User(UserData.length+1, _name, msg.sender, 0, 0));
    }

    // 유저 조회 기능 - 유저의 전체정보 번호, 이름, 주소, 점수를 반환. 
    function getUser(uint _n) public view returns(User memory) {
        return UserData[_n-1];
    }

    // 점수를 돈으로 바꾸는 기능 - 10점마다 0.1eth로 환전
    function changeScoreToMoney(uint _n) public {
        require(UserData[_n-1].score > 10, "If you want to change money, you need to have 10 scores at least");
        if(UserData[_n-1].score >= 20) {
            UserData[_n-1].score -= 20;
            UserData[_n-1].balance += 0.2 ether;
        } else {
            UserData[_n-1].score -= 10;
            UserData[_n-1].balance += 0.1 ether;
        }
    }
}

